import React from "react";

export default function MenuTabs({ selectedTab, setTab }) {
  return (
    <div style={{ display: "flex", justifyContent: "center", padding: 10 }}>
      {["Food", "Drinks"].map(tab => (
        <button
          key={tab}
          onClick={() => setTab(tab)}
          style={{
            padding: "10px 20px",
            margin: 5,
            background: selectedTab === tab ? "#007b8a" : "#ccc",
            color: "white",
            borderRadius: 5
          }}
        >
          {tab}
        </button>
      ))}
    </div>
  );
}
